import React, {useState} from 'react';
import axios from 'axios';
import Loader from 'react-loader-spinner';

interface ListingFormProps {
  setListings : (data: any) => void;
}

const ListingForm: React.FC<ListingFormProps> = ({setListings}) => {

  const [formData, setFormData] = useState({
    sale_type: 'For sale',
    price: '$0+',
    bedrooms: '0+',
    home_type: 'House',
    bathrooms: '0+',
    sqft: '1000+',
    days_listed: '1 or less',
    has_photos: '1+',
    open_house: 'false',
    keywords: ''
  })

  const {sale_type, price, bedrooms, home_type, bathrooms, sqft, days_listed, has_photos, open_house, keywords} = formData;

  const [loading, setLoading] = useState(false);

  const onChange = (e: React.ChangeEvent<HTMLInputElement>)=> setFormData({...formData, [e.target.name]: e.target.value});

  const onSubmit = (e: React.FormEvent<HTMLFormElement>)=> {
    e.preventDefault();

    axios.defaults.headers.common['Content-Type'] = 'application/json';
    setLoading(true);

    axios.post('http://localhost:8001/api/listings/search/', {sale_type, price, bedrooms, home_type, bathrooms, sqft, days_listed, has_photos, open_house, keywords})
    .then(res => {
      setLoading(false);
      setListings(res.data);
      window.scrollTo(0, 0);
    })
    .catch(err=> {
      setLoading(false);
      window.scrollTo(0, 0);
    })
  }

  return (
    <form className='listingForm' onSubmit={e=> onSubmit(e)}>
        <div className='row'>
          <div className='col-1-of-6'>
            <div className='listingform__section'>

            </div>
          </div>
        </div>
    </form>
  )
}

export default ListingForm
